import React, { useEffect } from 'react';
import './Preloader.css'
import Aos from 'aos';

const Preloader = () => {

    useEffect(() => {
        Aos.init({
            duration: 500,
            easing:'ease-in-out'
        })
    })

  return (
    <>
        <div className='preloaderComtainer' data-aos="fade-down">
            <h1 data>Ooo   Mama   Khadja</h1>
        </div>
    </>
  );
}

export default Preloader;
